function createLineChart(e,t,a){for(var s,e=document.getElementById(e),l={labels:a.xReference,datasets:[]},n=e=>s+=e,i=s=0;i<a.labels.length;i++)l.datasets[i]={label:a.labels[i],data:a.data[a.labels[i]].map(n)},l.datasets[i].borderColor=DashBoardColors.background[i+4],l.datasets[i].fill=!1,n=(t=>e=>t+=e)(0);new Chart(e,{type:"line",data:l,options:{responsive:!0,maintainAspectRatio:!1,legend:{position:"top",labels:{boxWidth:10,fontSize:8}},elements:{point:{pointStyle:"circle"},line:{tension:0}},title:{display:!0,text:t},scales:{yAxes:[{ticks:{stacked:!0,beginAtZero:!0,callback:function(e){if(e%1==0)return e},suggestedMax:4.1}}],xAxes:[{gridLines:{display:!1}}]}}})}